import React, { useEffect, useState } from "react";
import { Box, Typography, Grid, Paper, CircularProgress } from "@mui/material";
import { getAllOrders } from "../api/orders";

// ⚠️ ISSUE: OPTION_LABELS might have been missing or incomplete initially.
const OPTION_LABELS = {
    size: { 4: "Small", 5: "Medium", 6: "Large" },
    flavor: { 1: "Chocolate", 2: "Vanilla", 3: "Strawberry" },
    shape: { 7: "Round", 8: "Heart", 9: "Square" },
    toppings: { 10: "Choco Chips", 11: "Rainbow Sprinkler", 12: "Nuts", 13: "Fruits", 14: "Cherries" },
};

// ⚠️ ISSUE: safeParse was likely simplistic and only handled one data structure,
// leading to failures when parsing the 'flat' JSON format {size: 5, flavor: 1, ...}.
const safeParse = (val) => {
    if (!val) return null;
    try {
        const parsed = JSON.parse(val);
        // This simple return caused issues with distinguishing single options from toppings
        return {
            single: parsed,
            toppings: parsed.toppings || [],
        };
    } catch {
        return null;
    }
};

export default function OrdersPage() {
    const [orders, setOrders] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        // ❌ ERROR: 'username' was likely undeclared outside the try/catch, causing the "no-undef" error.
        const currentUserJSON = localStorage.getItem("currentUser");
        if (!currentUserJSON) {
            setOrders([]);
            setLoading(false);
            return;
        }

        let username;
        try {
            const currentUser = JSON.parse(currentUserJSON);
            username = currentUser.username;
        } catch (e) {
            setOrders([]);
            setLoading(false);
            return;
        }

        // ❌ ISSUE: Might have been missing the 'if (!username)' check.

        getAllOrders()
            .then((res) => {
                // ❌ ISSUE: Filtering by user might have been missing, showing ALL orders.
                setOrders(res.data); 
            })
            .catch(console.error)
            .finally(() => setLoading(false));
    }, []);

    if (loading)
        return <CircularProgress sx={{ mt: 5, display: "block", mx: "auto" }} />;

    if (!orders.length)
        return <Typography sx={{ p: 3 }}>You have not placed any orders yet.</Typography>;

    return (
        <Box sx={{ p: 3 }}>
            <Typography variant="h4" sx={{ mb: 3 }}>
                My Orders
            </Typography>

            <Grid container spacing={2}>
                {orders.map((order) => (
                    <Grid item xs={12} key={order.id}>
                        <Paper sx={{ p: 2 }}>
                            <Typography variant="h6">Order ID: {order.id}</Typography>
                            <Typography>User: {order.userName}</Typography>
                            <Typography>Total: ₹{order.totalPrice}</Typography>
                            <Typography>
                                Delivery Date: {new Date(order.deliveryDate).toLocaleDateString()}
                            </Typography>
                            <Typography>Delivery Slot: {order.deliverySlot}</Typography>

                            <Box sx={{ mt: 2 }}>
                                <Typography variant="subtitle1">Items:</Typography>

                                {order.items && order.items.length ? (
                                    order.items.map((item) => {
                                        const optionsData = safeParse(item.selectedOptions) || {};
                                        // ⚠️ ISSUE: The 'single' object here would contain both options and the 'toppings' array/key.
                                        const { single = {}, toppings = [] } = optionsData; 

                                        return (
                                            <Paper key={item.id} sx={{ p: 1, mt: 1 }}>
                                                <Typography>Name: {item.product?.name ?? item.name}</Typography>
                                                <Typography>Quantity: {item.quantity}</Typography>
                                                <Typography>Price: ₹{item.finalPrice}</Typography>

                                                <Box sx={{ mt: 1 }}>
                                                    <Typography variant="subtitle2">Options:</Typography>
                                                    
                                                    {/* ❌ ISSUE: This loop would display raw IDs (e.g., "size: 5") 
                                                        or display "Toppings: [11, 12]" if the array wasn't mapped/joined. */}
                                                    {Object.entries(single).map(([key, id]) => (
                                                        <Typography key={key} sx={{ pl: 2 }}>
                                                            {key.charAt(0).toUpperCase() + key.slice(1)}: {id}
                                                        </Typography>
                                                    ))}
                                                </Box>
                                            </Paper>
                                        );
                                    })
                                ) : (
                                    <Typography>No items found</Typography>
                                )}
                            </Box>
                        </Paper>
                    </Grid>
                ))}
            </Grid>
        </Box>
    );
}
